import React, { useState } from 'react'
import '../../Style/PostImg.css'
import AddPhotoAlternateIcon from '@material-ui/icons/AddPhotoAlternate';

function PostImg() {
    const[status, setStatus] = useState(true)
    function handelClick(){
        setStatus(!status)
    }
    return (
        <>
        {status?
        (
            <div className='postimg-img-box' onClick={handelClick}>
                <img className='postimg-img' src='https://cdn.britannica.com/24/174524-050-A851D3F2/Oranges.jpg'/>
            </div>
        ):(
            <div className='postimg-box' onClick={handelClick}>
                <AddPhotoAlternateIcon style={{fontSize: 200}}/>
            </div>
        )}
        </>
    )
}

export default PostImg
